import React from 'react';



const Profile = () =>{
    return(
        <div className='content col-7'>
        <div className='row'>
          <div className='col-12'>
            <img src='london.jpg'></img>
          </div>
          <div className='col-12'>ava+description</div>
          <div className='col-12'>my/new posts</div>
          <div className='col-12'>post 1.2...</div>
        </div>
      </div>
    )
}
export default Profile;
